// import logo from './logo.svg';
import './App.css';


/*
import images like this!
<img src={require('./images/cloud.jpg')} alt="" />
*/

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div>kaitlyn's site!</div>
      </header>
      <div className="row">
        <div className="column1">column 1!
          <div className="nav-list">
            <div className='nav-item'>
              <a href="home">home</a>
            </div>
            <div className='nav-item'>
              <img className="nav-img" src={require('./images/cloud.jpg')} alt="cloud icon"></img>
              <a href="about_me">about me</a>
            </div>
            <div className='nav-item'><a href="my_projects">my projects</a></div>
            <div className='nav-item'><a href="links">links</a></div>
            <div className='nav-item'><a href="fun_stuff">fun stuff</a></div>
          </div>
        </div>
        <div className="column2">column 2!</div>
      </div>
    </div >
  );
}

export default App;
